import React from 'react'
import {
  Typography,
  Container,
  Box,
  makeStyles,
} from "@material-ui/core";



function Report() {
 
  return (
  <Box>
    <Container>
    <Typography variant='h1'>Recharge Report</Typography>
    </Container>
  </Box>
  )
}

export default Report
